import NavBar from "./NavBar";
import SocialNetwork from "./SocialNetwork";
const Home = ()=>{
    return (
        <>
            <NavBar/>
            <div className="home">
                <SocialNetwork/>
                <div className="info">
                    <h2></h2>
                </div>
            </div>
        </>
        
    );
};

export default Home;
